import links from "../data/navigation";

function Header(props) {
    return (
      <div className="header">
        <h2>{props.title} {props.name}</h2>
        <div className="nav-decoration">
          {links.map((link) => {
            return (
              <a className="nav" href="#">{link.title}</a>
            )
          })}
        </div>
      </div>
    )
  }
  
  export default Header;
